import React from 'react'
import Users from "../"
const Listusers = ({ props }) => {
    return (
      <div className="flex-card" >
      {props.map((user, i) => {
        return (
          <div key={i}>

            <Users props={user}/>

          </div>
        );
      })}
    </div>
    );
  };
export default Listusers

